                        "Name": "카미사토류 · 거울꽃",
                        "Desc": "카미사토 아야토는 까치발로 이동하며 「선회하는 거울꽃」 상태에 진입한다.<br>이동 후, 카미사토 아야토의 원래 자리에 「물의 잔영」이 생성된다. 물의 잔영이 완전한 형태를 갖춘 후, 아야토 주변에 적이 존재하거나 지속 시간이 끝나 물의 잔영이 파괴되면 <color style='color:#80C0FF;'>물 원소 범위 피해</color>를 준다.<br><br><color style='color:#FFD780;'>선회하는 거울꽃</color><br>해당 상태의 카미사토 아야토는 순수검으로 빠르게 공격하고, 일반 공격으로 주는 피해는 다른 원소 부여 효과로 대체될 수 없는 <color style='color:#80C0FF;'>물 원소 범위 피해</color>로 전환된다.<br>이외에 아래의 효과를 가진다:<br> · 순수검이 적 공격 후, 카미사토 아야토에게 「번쩍이는 파도」 효과를 부여한다. 현재 카미사토 아야토의 최대 HP에 따라 순수검이 주는 피해가 증가한다. 번쩍이는 파도는 초기에 최대 4스택 중첩되며 0.1초마다 순수검의 공격을 통해 1스택 중첩된다. 선회하는 거울꽃 상태가 해제될 때 사라진다.<br> · 카미사토 아야토의 경직 저항력 증가.<br> · 강공격과 낙하 공격 사용 불가.<br><br>선회하는 거울꽃 상태는 카미사토 아야토 퇴장 시 해제된다. 선회하는 거울꽃 상태에서 카미사토류 · 거울꽃을 다시 한번 발동하면 선회하는 거울꽃 상태가 해제된다.<br><br><i>「언제부터 네 공격이 나에게 닿았다는 착각을 하게 된 거지?」</i><br><i>——무예뿐만 아니라, 권모술수도 마찬가지다. 하지만 다른 쪽 봉행 어르신들의 체면도 봐줘야 되기에 이 말은 토마, 이토와 아야카밖에 못 들어봤다</i>",
